Previously, we discussed how to use the `IanPropertyChanged` event to update the state of a domain entity. In this blog post, we will explore how to utilize the `IanPropertyChangedEventArgs` class to notify subscribers when an entity's properties change. This approach allows you to create rich domain models with intricate relationships and behavior while benefiting from clean and simple code.

Let's start by revisiting our previous example:
```csharp
public class Order
{
    public int Id { get; set; }
    public Customer Customer { get; set; }
    public List<Product> Products { get; set; }
}

public class Customer
{
    public string Name { get; set; }
    public Address Address { get; set; }
    public List<Order> Orders { get; set; }
}

public class Address
{
    public string Street { get; set; }
    public string City { get; set; }
    public string State { get; set; }
    public string ZipCode { get; set; }
    public List<Customer> Customers { get; set; }
}
```
As you can see, the `Order` entity has a reference to the `Customer`, which in turn has references to multiple orders. This allows for complex relationships and behavior within your domain model. However, this also means that when an order changes, it may affect other entities as well. In such cases, you can use the `IanPropertyChangedEventArgs` class to notify subscribers about these changes:
```csharp
public interface ISubscriber
{
    void PropertyChanged(string propertyName);
}

public class OrderRepository : IRepository<Order>
{
    public event EventHandler<IanPropertyChangedEventArgs> PropertyChanged;

    public void Save(Order order)
    {
        if (PropertyChanged != null)
        {
            var args = new IanPropertyChangedEventArgs();
            PropertyChanged(this, args);
        }

        // Save to the database or perform other actions
    }
}
```
In this example, we define an `ISubscriber` interface that contains a single method, `PropertyChanged`. The `OrderRepository` class implements this interface and subscribes to it. When an order is saved, it checks if the `PropertyChanged` event is set, and if so, it raises the event with the `IanPropertyChangedEventArgs` object as an argument. This allows any subscribers to react to the change in properties of the `Order`.
